import React from 'react'
import styles from './index.module.css';
import MainTitle from '../../components/MainTitle';
import MyButtonValue from '../../components/MyButtonValue';

export default function Home({ page_list, set_page_index }) {

  return (
    <div className={styles.main_div}>
      <MainTitle title="Домашняя страница" />
      <div className={styles.div_button}>
        {Object.keys(page_list).map((e) => (
          <>
            {page_list[e] !== "" ? (
              <MyButtonValue
                className={styles.my_button}
                key={e}
                data={e}
                callback={set_page_index}
              >
                {page_list[e]}
              </MyButtonValue>
            ) : null}
          </>
        ))}
      </div>
    </div>
  );

}
